  true,\n\t\"url\": null,\n\t\"notes\": \"The data was produced as part of the Feed
  the Future Innovation Lab for Collaborative Research on Peanut Productivity and
  Aflatoxin Control (the Peanut & Mycotoxin Innovation Lab, PMIL) subaward to the
  USDA Agricultural Research Service's National Peanut Research Lab in Dawson, GA
  entitled, Silencing of Aflatoxin Synthesis through RNA Interfence (RNAi) in Peanut
  Plants. The project has two main objectives, to study the genetic diversity of Aspergillus
  species collected in PMIL target countries and the USA, and to develop peanut lines
  containing RNAi gene constructs to reduce aflatoxin contamination by Aspergillus
  flavus infection. The data were produced as part of the first objective on genetic
  diversity. The genomes are available at National Center for Biotechnology Information
  (NCBI) database found at the landing page identified below using the numbers listed
  in the reference AccessionNumbers.txt.\",\n\t\"license_title\": \"Other License
